    [],nt"num_tags": 6,nt"name": "arctic-national-wildlife-refuge-annual-narrative-report-calendar-year-1995",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Arctic
    NWR outlines Refuge accomplishments during the 1995 calendar year. The report begins
    with a summary of the year's highlights and weather conditions. Land acquisition
    is covered. The report includes a planning section which discusses management planning,
    compliance with environmental and cultural resource mandates, and research and investigations.
    Refuge administration is outlined; information about personnel, volunteer programs,
    funding, and safety is given. Habitat management is also covered; subjects include
    fire management, water rights, and wilderness areas. The wildlife section of the
    report discusses wildlife diversity, endangered and threatened species, waterfowl,
    marsh birds and waterbirds, shorebirds, raptors, game mammals, marine mammals, fisheries
    resources, scientific collections, animal control, marking and bird banding, and
    disease control. The public uses of the Refuge described in this report include
    outdoor classrooms, interpretive programs, hunting, fishing, trapping, outdoor recreation,
    and law enforcement. The equipment and facilities section of the report provides
    information about new construction, equipment replacement, communication systems,
    computer systems, and energy conservation. Cooperative programs, economic uses of
    the Refuge, and items of interest are provided at the end. Newspaper articles are
    attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
